import React from 'react';

function UserItem(props) {
    const {name, email,image, isGoldClient,salary} = props;

    return (
        <div>
            <h3>{ name }</h3>
            <p>{ email }</p>
            <p>{ salary }</p>
            <img src={{image}} alt="imagine indisponibila " />
            { isGoldClient
                ? <h3>Client GOLD</h3>
                : null
            }
        </div>
    );
}

export default UserItem;
